import React from "react";

const UserResume = ({ resume }) => {
  const { first_name, last_name, phone_number, address, designation, city } =
    resume.about;
  return (
    <div className="">
      <div>Name:{first_name}</div>
      <div>Last_Name:{first_name}</div>
    </div>
  );
};

export default UserResume;
